function checkNum(e){return e<10?`0${e}`:e}function getTime(){let e=DateTime.local(),s=DateTime.fromISO(e.toString()),t=theBigDay.diff(s,selections);return{seconds:checkNum(t.seconds.toFixed(0)),minutes:checkNum(t.minutes),hours:checkNum(t.hours),days:checkNum(t.days),months:checkNum(t.months)}}self.importScripts("../vendor/luxon.js");var DateTime=self.luxon.DateTime,selections=["months","days","hours","minutes","seconds"],theBigDay=DateTime.fromISO("2018-12-01T17:30:00");postMessage(getTime());var t=self.setInterval(function(){postMessage(getTime())},1e3);